import Mtitle from './MainTitle';
import Navbar from './NavBar';
import Gallery from './Gallery';
import AudioPlayer from './components/Audio';
import Clock from './components/Clock.js';
import './Style.css';



function App() {
  return (
    <div className="app-container">
      <header>
        <Clock/>{}
        <Mtitle/>{}
        <Navbar/>{}
        <Gallery/>{}
        <AudioPlayer/>{}
      </header>
    </div>
  );
}

export default App;
